import React from "react";
import "./Home.css"; // Styling for the Home Page

function Home() {
  const handleStartGame = () => {
    console.log("Start Game clicked!");
  };

  const handleToggleLED = () => {
    console.log("Turn On LED clicked!");
  };

  return (
    <div className="home-container">
      <h1 className="title">Welcome to Montessori App</h1>
      <div className="button-group">
        <button className="home-button" onClick={handleStartGame}>
          Start Game
        </button>
        <button className="home-button" onClick={handleToggleLED}>
          Turn On System
        </button>
      </div>
    </div>
  );
}

export default Home;
